import React from 'react';

const Experience = () => {
    return (
        <div className="experience">
            <div className="job">
                <img src="godaddy_logo.png" alt="GoDaddy Logo" />
                <h3>System Engineer II</h3>
                <p>GoDaddy</p>
                <p>Jul 2021 - Present</p>
                <p>Phoenix, Arizona Area</p>
                <ul>
                    <li>Lead System Administrator for Technical Leads</li>
                    <li>Created technical documentation using Jira and Confluence</li>
                    <li>Incident management and alert monitoring on a large server network</li>
                    <li>Skills: Analytics, AWS, Data Analytics, Data Science</li>
                </ul>
            </div>
            {/* Add more job entries as needed */}
        </div>
    );
};

export default Experience;
